  - type: RichText
    properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
      foreground: '', visible: true, font_size: null, content: "**I.\tIdentification**\n\
        1.\tTheme /Subject: Jebel Harraba stalactite and stalagmite cave\n2.\tSite:\
        \ Jebel Harraba\n3.\t Location: 36.02955, 8.32721\n\n**II.\tAdvice and practical\
        \ information** :\n\n- Land status: State-owned\n- Access: easy via tarmac\
        \ road in good condition\n- Departure point: the town of Le Kef (fig.2). \n\
        - Distance: approx. 42 km\n- Lack of signposting\n- Undeveloped site access\
        \ paths\n- Risk of the site disappearing\n- Protect the site by closing the\
        \ gallery with a wrought-iron gate.\n- Put up signs prohibiting the removal\
        \ of calcite crystals from inside the gallery.\n- Access to the cave is a\
        \ little difficult (steep slope) for the elderly. It is advisable to build\
        \ stairs to facilitate descent into the cave.\n- Please bring a helmet, hiking\
        \ boots and a flashlight.\n\n\n**III.\tSite description**\n\n**1.\tWhy visit\
        \ the site?**\n\nAccess to the site is via the GP 5 towards Sakiet Sidi Youssef.\
        \ Before reaching the Oued Mell\xe8gue bridge, there are three stops (fig.2):\n\
        - Stop 1: Observe a variegated Triassic outcrop of gypsum, clay, sandstone\
        \ and dolomite. If you're curious and look closely, you'll find some beautiful\
        \ bipyramid quartz crystals that can be removed by hand or hammer;\n\n- Stop\
        \ 2: Jebel Saddine nature reserve. For more details, see this link: (https://rsis.ramsar.org/fr/ris/2220).\n\
        \n- Stop 3: Along the road, just before the Oued Kohol bridge, you can see\n\
        \nAn outcrop of black limestone platelets dating from the Albian (-108 to\
        \ -96 Ma). \nThe black color of this outcrop is due to the presence of organic\
        \ matter.\nGalena (lead) crystals can be collected here from the old mines\
        \ located upstream and drained by Oued Kohol.\n\nWe then continue towards\
        \ the Sid Rabah cave, taking the secondary road that leads to the village\
        \ of Sidi Rabeh and on to Tajerouine (fig. 2). The average distance is around\
        \ 42 km.\n\n**Landscape interest**\n\nArriving in the area, one is struck\
        \ by a distinctive landscape made up of a series of dark-colored carbonate\
        \ massifs, sometimes peaking at 900 m, in the midst of vast flatlands whose\
        \ altitude does not exceed 300 to 400 m (J. Harraba, Slata, Jerissa). Several\
        \ massifs with similar facies can also be observed on the Algerian side. \
        \ There are no dense forests, as is the case north of the town of Le Kef.\
        \ Agricultural fields are less fertile than in the Kef region. This vast area\
        \ is crossed by the Oued Mell\xe8gue, which rises in Algeria.\n\n**Mineralogical\
        \ interest**\n\nThese carbonate massifs are highly fractured and even karstified.\
        \ Water percolating through the cracks is loaded with calcium carbonate, which\
        \ precipitates when it falls to the bottom of the cavities. The structures\
        \ formed are of two types: stalactites and stalagmites.\n\nStalactites form\
        \ elongated calcite crystals, clinging to the ceilings of cavities and pointing\
        \ downwards. Stalagmites form elongated calcite crystals attached to the foot\
        \ of cavities and pointing upwards.\nThe Jebel Harraba massif contains a cave\
        \ (a former lead mine) with beautiful stalactite and stalagmite structures.\
        \ Access to the cave is via an 80 m-long gallery dug into the northern flank\
        \ of the Jebel Harraba massif, 200 m from the track leading to the village\
        \ of Si. Rabeh (figs. 2, 3 and 4). \n\n The cave comprises a main chamber\
        \ connected to several chimneys and corridors. It is the main chamber that\
        \ contains the spectacular stalactites and stalagmites (photos).\n\n**2.\t\
        Summary of important information to remember **\n\n**Geological interest**\n\
        \nThe mountain massifs are composed of reef limestones of Aptian age (-114\
        \ to -108 Ma).\n\n", font: '', spacing_above: small, spacing_below: small,
      data: null, background: '', format: markdown}
